import React, {
   useState,
   Fragment
 } from 'react';
import 'react-bulma-components/basic/react-bulma-components.min.css';
import Navbar from 'react-bulma-components/lib/components/navbar';
import Box from 'react-bulma-components/lib/components/box';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Redirect,
  Link,
} from "react-router-dom";
import { select, boolean } from '@storybook/addon-knobs';
import Bottle from "./Bottle.component";
import Brush from "./Brush.component";
import Build from "./Build.component";
import Cap from "./Cap.component";
import Index from "./Index.component";
import Rod from "./Rod.component";
import Wiper from "./Wiper.component";

const colors = {
  Default: '',
  primary: 'primary',
  info: 'info',
  danger: 'danger',
  warning: 'warning',
  success: 'success',
  white: 'white',
  black: 'black',
  light: 'light',
  dark: 'dark',
  link: 'link',
};

const Mainbar = ( props ) => {
storiesOf('Navbar', module)
  .addDecorator(story => (
    <div>
      {story()}
      <Box style={{ margin: '15px auto', maxWidth: '75vw' }}>
        Check the Know tab to see the behavior of this component
      </Box>
    </div>
  ))
  .add('Default', (() => {
    return (

    <div>
    <Navbar
      color={select('Color', colors)}
      fixed={select('Fixed', { default: undefined, top: 'top', bottom: 'bottom' })}
      active={boolean('Active', false)}
      transparent={boolean('Transparent', false)}
    >
      <Navbar.Brand>
        <Navbar.Item renderAs="a" href="#">
          <img src="https://bulma.io/images/bulma-logo.png" alt="Logo" width="112" height="28" />
        </Navbar.Item>
        <Navbar.Burger />
      </Navbar.Brand>
      <Navbar.Menu >
        <Navbar.Container>
          <Navbar.Item href="/index">
            Index
          </Navbar.Item>
          <Navbar.Item href="/bottle">
            Bottle
          </Navbar.Item>
          <Navbar.Item href="/brush">
            Brush
          </Navbar.Item>
          <Navbar.Item href="/build">
            Build
          </Navbar.Item>
          <Navbar.Item href="/cap">
            Cap
          </Navbar.Item>
          <Navbar.Item href="/rod">
            Rod
          </Navbar.Item>
          <Navbar.Item href="/wiper">
            Wiper
          </Navbar.Item>
          <Navbar.Item href="/add">
            Add component
          </Navbar.Item>
        </Navbar.Container>
      </Navbar.Menu>
    </Navbar>

    <Switch>
      <Route exact path = "/" component = { ( Index ) } />
      <Route path = "/cap" component = { ( Cap ) } />
      <Route path = "/wiper" component = { ( Wiper ) } />
      <Route path = "/rod" component = { ( Rod ) } />
      <Route path = "/brush" component = {  Brush } />
      <Route path = "/bottle" component = { Bottle } />
      <Route path = "/build" component = { Build } />
      <Route path = "*" component = { NotFound } />
    </Switch>
  </div>
  );
}));
}

export default Mainbar;

export const NotFound = ( props ) => {
  return (
    <h1> Pagina no encontrada </h1>
  )
}
